Yah, untuk informasi, Proses memumikan jasad orang meninggal tidaklah sederhana, yakni caranya jasad diposisikan dalam keadaan duduk, lengkap dengan pakaian kebesarannya. Kemudian jasad diasapi di depan api unggun selama satu bulan di dalam Honai Pilamo, rumah khusus kaum pria. Setelah itu, jasad akan dibungkus daun pisang hingga mengeras menjadi mumi. Proses ini akan memakan waktu sekitar 5 tahun. Untuk perawatan mumi, kaum pria akan melumurinya dengan minyak babi dan menyimpannya setiap malam di depan api unggun dalam Pilamo. Hal ini akan membuat mumi semakin awet tanpa harus khawatir rusak karena rayap.

Lokasi :
Distrik Kurulu berada sebelah utara Kota Wamena, Kabupaten Jayawiya, Papua, Indonesia. 

n.b :
Foto diambil pada tahun 2014. Usia Mumi lebih dari 200 tahun. 

